import React from "react";
import Header from "../components/header";
import styles from "./cart.module.css";
import { Link } from "react-router-dom";

function Cart() {
  return (
    <>
      <Header />
      <div className={styles.CartSection}>
        <div>dd</div>
      </div>
    </>
  );
}
export default Cart;
